INSERT INTO tb_ywtsk_task_cl (YWTSK_COD_TASK_PK,YWTSK_NOTE_NOTA,YWTSK_YWTTS_COD_TIPOTASK_PK,YWTSK_YWATT_COD_ATTIVITA_PK,YWTSK_NUM_EFFORT,YWTSK_DATA_CREAZ,YWTSK_DATA_UPDATE,YWTSK_COD_USER) VALUES (45,'durante la fase di presa in carico del software di HP si sono svolte più sessioni di test volte a comprendere le motivazioni del mancato caricamento della base dati del "Debitore MAV" al fine di riprodurre gli errori registrati in ambiente di esercizio e di applicare le dovute correttive.\n\n[Effort: 10GG]',147,2,null,{ts '2016-07-01 14:14:01.'},{ts '2016-12-15 14:19:17.'},'ELFWeb');
INSERT INTO tb_ywtsk_task_cl (YWTSK_COD_TASK_PK,YWTSK_NOTE_NOTA,YWTSK_YWTTS_COD_TIPOTASK_PK,YWTSK_YWATT_COD_ATTIVITA_PK,YWTSK_NUM_EFFORT,YWTSK_DATA_CREAZ,YWTSK_DATA_UPDATE,YWTSK_COD_USER) VALUES (46,'in merito alla documentazione fornita dal referente di istituto si è provveduto a:\n\n- prelevare il software dai repository CVS e configurarlo sulle macchine.\n- tramite un processo di reverse engineering si sono compresi e definiti i flussi operativi del software preso in carico, in quanto la documentazione fornita rappresentava un stadio di lavorazione e non la fotografia dell''AS-IS rilasciato in ambiente di Esercizio.\n- si è provveduto quindi ad un''attività di miglioramento e ottimizzazione del software preso in carico\n- si sono eseguite attività di test integrato e di non regressione.\n\nAl fine di garantire la corretta distribuzione del know-how acquisito le attività descritte sono state eseguite da tre persone.\n\n[Effort: 35]\n',156,2,null,{ts '2016-06-09 14:19:34.'},{ts '2016-12-15 14:27:29.'},'ELFWeb');
INSERT INTO tb_ywtsk_task_cl (YWTSK_COD_TASK_PK,YWTSK_NOTE_NOTA,YWTSK_YWTTS_COD_TIPOTASK_PK,YWTSK_YWATT_COD_ATTIVITA_PK,YWTSK_NUM_EFFORT,YWTSK_DATA_CREAZ,YWTSK_DATA_UPDATE,YWTSK_COD_USER) VALUES (47,'durante la fase di realizzazione del software e di verifica di quanto realizzato si è provveduto ad analizzare precise precedenti segnalazioni provenienti da MI in merito al mancato aggiornamento sulle basi dati del debitore.\n\n[Effort: 5GG]\n\n',148,2,null,{ts '2016-07-13 14:31:54.'},{ts '2016-12-15 14:35:25.'},'ELFWeb');
